        public BookService(ICrudServicesAsync service, ApplicationDbContext context)
        {
            _service = service;
            _context = context;
        }



        public IQueryable<BookDTO> GetBooks(SortFilterPageOptions options)
        {
            var booksQuery = _service.ReadManyNoTracked<BookDTO>();

            options.SetupRestOfDto(booksQuery);
            booksQuery = booksQuery.OrderBy(x => x.Name);

            return booksQuery.Page(options.PageNum - 1,
                    options.PageSize);
        }
        public IQueryable<BookDTO> GetBooksTotalCount(SortFilterPageOptions options)
        {
            var booksQuery = _service.ReadManyNoTracked<BookDTO>();
            booksQuery = booksQuery.OrderBy(x => x.Name);
            options.SetupRestOfDto(booksQuery);

            return booksQuery;
        }
